<script>
import axios from 'axios';
import Qs from 'qs';
export default {
    data(){
        return{
            
        }
    },
    components: {
    },
    methods:{
       navigateToThree: function() {
        // 获取所选的年龄选项。作为结果页的参考项
        let selected = document.querySelector('.selected');
        if (selected != null) {
            let age = selected.getAttribute('data-age');
            localStorage.setItem('age', age);
            // 判断是男的还是女的。如果是女的，跳转至3-1；如果是男的，跳转至3-2
            let gender = localStorage.getItem('gender');
            if (gender === '男') {
                this.$router.push({path: 'three2'})
            } else {
                this.$router.push({path: 'three'})
            }
        }
       },
       selectOption: function(e) {
            e.preventDefault();
            //  获取所有的p元素并经class置为空
            //  选中当前选中的选项
            let p = document.querySelectorAll('.wrap-select p');
            if (e.target.parentNode.nodeName.toLowerCase() === 'p') {
                p.forEach((item) => {item.classList = ''});
                e.target.parentNode.classList.add('selected');
            }
        }
    },
    created(){

    },
    mounted(){
       
    },
    destroyed(){

    }
}
</script>

